import React, { Component } from 'react'

export default class Home extends Component {
    render() {
        return (
            <>
            <h3>我是Home的内容</h3>
            <div>
                <ul className="nav nav-tabs">
                    <li>
                        <a>News</a>
                    </li>
                </ul>
            </div>
            </>
        )
    }
}
